var a = 'active';

// Steps

function steps(e, step_name) {
    var e = $(e),
        step = $('.' + step_name + '_step').eq(e.index());

    if (!e.hasClass(a)) {
        steps_line(e);
        e.addClass(a).siblings().removeClass(a);
        step.slideDown().addClass(a).siblings('.' + step_name + '_step').slideUp().removeClass(a);
    }
}

function steps_line(e) {
    var e = $(e),
        line = e.parent().siblings('.line');

    if (line.length) {
        line.css({
            'left': e.position().left - 12,
            'width': e.outerWidth() + 24
        })
    }
}

$(document).ready(function () {
    steps_line('.code_tab.active');
})


// Auto height

function auto_grow(element) {
    element.style.height = "5px";
    element.style.height = (element.scrollHeight)+"px";

    if (!$(element).parent().hasClass(a)) {
        $(element).parent().hide();
    }
}

$(document).ready(function () {
    $('.code_step textarea').each(function () {
        auto_grow(this);
    })
})



// Code copy

$(document).on('click', '.code_step_copy', function () {
    var text = $(this).siblings('textarea').val();

    console.log(text);

    if(!$(this).find('.input_copied').length) {
        var input = $('<textarea class="input_copied"></textarea>').val(text);
        input.css({
            'position': 'absolute',
            'left': '-9999px'
        });
        $(this).append(input);
    }

    input = $(this).find('.input_copied');
    $(input[0]).val(text)
    input[0].select();
    input[0].setSelectionRange(0, 99999)
    document.execCommand('copy');
})



// Form nav

$(window).scroll(function () {
    if ($('.knot_form_item').length) {
        $('.knot_form_item').each(function () {
            var w_scroll = $(window).scrollTop(),
                e = $(this),
                e_top = e.offset().top,
                e_height = e.height(),
                e_index = e.index(),
                line = $('.knot_form_nav .line'),
                nav = $('.knot_form_nav_item');

            if (w_scroll + 20 >= e_top) {
                nav.eq(e_index).addClass(a).siblings().removeClass(a);
                line.css({
                    'top': nav.eq(e_index).position().top + nav.parent().position().top - 30,
                    'height': nav.eq(e_index).height()
                })
            } else if (w_scroll <= $('.knot_form_item').eq(0).offset().top) {
                nav.eq(0).addClass(a);
                line.css({
                    'top': nav.eq(0).position().top + nav.parent().position().top - 30,
                    'height': nav.eq(0).height()
                })
            }
        })
    }
})



//Медленный сролл к якорю

function scroll_to(e) {
    if ($(e).length != 0) {
        $('html, body').animate({
            scrollTop: $(e).offset().top - 19
        }, 500);									//Время за которое происходит скролл
    }
}



// Select

if ($('.select select').length) {
    $('.select select').knotSelect();
};



// Ask

var ask_out;

$(document).on('click', '.ask_button', function () {
    $('.ask').toggleClass(a);

    if (!$('.ask').hasClass(a)) {
        $('.ask').removeClass('_thank');

        clearTimeout(ask_out);
    }
})

$(document).on('click', function(event) {
    if ($(event.target).closest('.ask').length === 0) {
        $('.ask').removeClass('active _thank');
        clearTimeout(ask_out);
    }
});

$(document).on('click', '.ask_form_button', function () {
    $('.ask').addClass('_thank');

    ask_out = setTimeout(function() {
        $('.ask').removeClass('active _thank');
    }, 3000);
})